(6,	6,	1,	4,	205,	'Roman is exemplary in demonstration of CI Cultural Behaviors. She has moved to another role  but she is supportive of her former Finance team.  ',	'2018-12-30 10:57:20',	239,	239,	'2018-12-30 23:00:27'),
