(38,	26,	11,	3,	62,	'N/A',	'2018-10-25 11:30:05',	542,	542,	'2018-10-25 11:35:06'),
(40,	26,	3,	4,	615,	'Shiphrah, \nYou deserve this recognition for showing excellent leadership skills during Eastern Base tournament preparation . You were able to divide duties among your team\n. You were general overseer but details and day to day here and there supervisions were under the appointed team lead. \n.You showed relaxed, meaning you believed your team, capacities to perform the duties you have provided. \nGreat congratulations my sister keep it up! ',	'2018-12-28 08:42:50',	542,	542,	'2018-12-28 08:47:23'),
(42,	26,	2,	4,	0,	'My Dear Sister Sifu Susan Mohamed, \nIt is my pleasure to recognize your self motivation spirit that you demonstrated during Eastern Base youth preparation for National sports tournament in July 2018. \nDuring that time it was hard, it was nobody knew how to go about this, but you took personal initiative to list important aspects for the events to succeed and you personally shared with the tournament preparation team. You were not appointed to that but you decided to share your experience to support. \nYou really demonstrated \"UKOMAVU\"  when you saw young generation in the ministry is organization is struggling you did not keep quite to let the mission fall down but you supported them so they grow. \nThank you, your initiative, have added value and learning in the lives of those you have supported during tournament preparation. ',	'2018-10-25 11:34:51',	542,	542,	'2018-12-19 14:11:57'),
(44,	26,	4,	4,	609,	'Dear Rebeca, \nDuring registration at new FCPs in Dar es salaam you showed excellent service to partners because though it was requirements for FCPs to make registration themselves but you went extra mile after training how they can conduct registration you made phone support, you were available for them in here and there inquiry response, you went and captured photos yourself to meet the deadline. This is unique heart not to ignore. \nContinue to serve with that spirit. ',	'2018-12-28 08:47:24',	542,	542,	'2018-12-28 08:52:18'),
(46,	26,	10,	3,	0,	'N/A',	'2018-10-25 11:35:04',	542,	542,	'2018-10-25 11:35:04'),
(48,	26,	66,	4,	587,	'My Dear Sister Sifu Susan Mohamed, \nIt is my pleasure to recognize your self motivation spirit that you demonstrated during Eastern Base youth preparation for National sports tournament in July 2018. \nDuring that time it was hard, it was nobody knew how to go about this, but you took personal initiative to list important aspects for the events to succeed and you personally shared with the tournament preparation team. You were not appointed to that but you decided to share your experience to support. \nYou really demonstrated \"UKOMAVU\"  when you saw young generation in the ministry is organization is struggling you did not keep quite to let the mission fall down but you supported them so they grow. \nThank you, your initiative, have added value and learning in the lives of those you have supported during tournament preparation.\n',	'2018-12-19 02:02:23',	542,	542,	'2018-12-28 08:41:48'),
