(502,	78,	66,	4,	602,	' During the  third week of September 17th to 21st \nThere were several meeting taking places from various unit Nelly Nalama you were so eager to serve each team in a professional manner.\nYou did a follow up to ensure that each team have water and sweats which was something I have never experience before.  You were charming and willingly to extend to serve all the team instead of relying on Edna. Keep it up  that spirit as it was very encouraging to all of us.\n',	'2018-11-14 12:19:25',	595,	595,	'2018-11-14 12:20:25'),
(504,	78,	54,	2,	1,	'none',	'2018-11-14 12:24:00',	595,	595,	'2018-11-14 12:45:36'),
(506,	78,	16,	2,	1,	'Business Team(Makene team)\nDuring the Month of July to October you planned to visit each function member home as part of team building  activities with intention of ensuring all member knows the home of their friends/workmate.\nOn each day 90% of members were able to go for the home visit but you also did take time to pray and advice the family you visited on various matters such as better ways to utilize our home/lands.\nThat loving spirit goes more than just fulfilling the plan you have put in place; the visit was more than just team building! \n You have shown 100% for one another not only during visit but also during sharing On Monday and Friday. Each was ready to encourage and help each other goals of the week as well as the fault correction.\nKeep up the good spirit and come up with more innovative ideas to keep the team united. God blesses each one of you.\n',	'2018-11-14 12:25:38',	595,	595,	'2018-11-14 12:25:38'),
(508,	78,	12,	3,	0,	' Sport tournament preparation team.\n  during the Month of  J September to November the team was able to set time to go through  various preparation including visiting various offices as part of preparation.\n in some of the offices the team had to go several time before they  be allowed to meet the  intended person.\n well done',	'2018-11-14 12:42:41',	595,	595,	'2018-11-14 12:45:28'),
(510,	78,	4,	4,	542,	'  During the visit in October  as part of program learning.\nyou have been a PF for clusters in Turiani and Morogoro for only two years.  during the visit to your clusters the following was observed.\n- FCP commitment and care giver involvement in the ministry.\n-utilization of Qavah to an extent of all the ICP to  build toilet and classroom with support from care giver.\n during testimonies from care givers and partners it was clear that you did took serious your role as a PF in facilitating these ICPs.\nNo wonder they gave you name Mwenge, Baba, Police and so many other names.\n the good thing is that you have left a mark in those district that they will always remember.\nwell done brother.',	'2018-11-14 12:27:45',	595,	595,	'2018-11-14 12:33:40'),
(512,	78,	2,	4,	587,	'During the first a week of November,\none of our  collidge lost  her bereaven , you went an exta commitment by volunteering to travel to escort our dear sister.\ni appeciate that since you did not care weather  socoal welfare will cover your expenses you went ahead and took leave to attent the buria ceremony.\n Thank you for that loving heart.\nGod bless you',	'2018-11-14 12:33:01',	595,	595,	'2018-11-14 12:37:21'),
(514,	78,	1,	4,	554,	'  for several month of  July to December  all the ICP were to finalize details on GDPR.  despite the fact you shared your  analyisis weekly. you took matter further by voluntarily calling the PF whom they  ICP have not  done as expected. you never gave up but kept on reminding them to an extent that the Country was able to be recognized.\nKeep up the good spirit of  being there for other as you could have opted to do your part and sit and wait for worse to come.',	'2018-11-14 12:38:14',	595,	595,	'2018-11-14 12:42:01'),
