(724,	92,	66,	4,	584,	'Dear Frank  Mganga\nI want to appreciate you for the great work you have been doing for the program training team.\nYou are employed as a trainer but you do an extra work of driving long safari yet you have to stand to train sometimes a whole day.\nThese are the long trips I remember them:\nIn July you drove to Mahenge Morogoro.It was a two days safari and you had to train leadership alone in that church.\nIn August you drove to Simiyu this was a complicated safari, you drove in rough road, the centers were so scattered, yet you had to train at you center after the long driving journey.\nIn September you drove to Chato to drop one of the trainers then in the next morning you had to drive back to Geita for training still by yourself.\nIn the month of October 2018 you drove a car taking from Arusha to Misenyi  Kagera \nOn November you drove to Morogoro and you had to train too.\nOne thing I noted is that you have been doing this happily from your heart. Thanks brother for the great work \n',	'2018-11-23 06:06:43',	557,	557,	'2018-11-23 07:58:53'),
