(1104,	128,	4,	4,	542,	'In two years Elijah Bayyo has been a PF for Morogoro Turian and Kilosa. In October 2018 I had an opportunity to visit these clusters and meeting wih FCP leaders. I was amazed by great and wonderful work done at those FCPs. Number of infrastructures for each FCP through local resources three classrooms, 10holes Toilets for each FCPs and office for CDWs. the most amazing is how Church mobilized community and caregivers to participate in the life of the project. Systematic follow of beneficiaries and how is integrated in the life of the Church not only as the project. All FCP Pastors and leaders did not stop commending the PFs for his support and tireless support to them. The key message observed is that all FCPs were mobilized to protect and serve Children. Even the government did not stop commending for observed good work even outside view.',	'2018-12-05 09:05:34',	570,	570,	'2018-12-27 07:09:39'),
