(1151,	92,	68,	3,	0,	'Nomination for curriculum translation review.\nDear training team! \nYou are a great team, committed a huge asset to our ministry and is so deserving an award and recognition this cycle from God and Men.  Just to write a little about what you did as a team.\nCurriculum Translation Review \nFor so long our CDWs and especially CYTs in our FCPs have been facing a challenge in the use of Compassion English Curriculum. This curriculum is so powerful and use full to our beneficiaries and even children that are not beneficiaries but having it in English was a great barrier towards its implementation in real life. \nI come to learn that over the years back this work was done, and the ministry invested allot of money in it, yet no results were seen since the work was poorly done, almost to zero, many gave up on it! This time (As from July 018) you took the initiative as a team to review the documents word by word. First it was not in your key dates and I can imagine reading a document of more than two hundred pages word by word to ensure that each sentence and word is perfectly translated in reference to our context. Am sure some of you must have had sleepless nights just to make sure that this is achieved. \nMany were seeing this as an impossible task, but this team had no reason to give up; on September 2018, I saw an email from Program training manager informing TZ PF Staff that the translation review of Year 1 lessons for all ages has already been done and approved by NLT. What good news to our ministry! To some of our FCPs staff it was like a woman who has been waiting for a child for so long and all over a sudden God blessed her with a child at old years of her life. You went an extra mile for sure. The reviewing of this curriculum has helped CDWs and CYTs provide excellence and effective service to children, youth, church at large and over long run our Nation. Thanks so much training team for your commitment toward s this, I encourage you to keep the fire burning and go for Year two curriculum.\n',	'2018-12-11 12:15:54',	557,	557,	'2018-12-11 12:15:54'),
(1152,	92,	10,	3,	0,	'Nomination for curriculum translation review.\nDear training team! \nYou are a great team, committed a huge asset to our ministry and is so deserving an award and recognition this cycle from God and Men.  Just to write a little about what you did as a team.\nCurriculum Translation Review \nFor so long our CDWs and especially CYTs in our FCPs have been facing a challenge in the use of Compassion English Curriculum. This curriculum is so powerful and use full to our beneficiaries and even children that are not beneficiaries but having it in English was a great barrier towards its implementation in real life. \nI come to learn that over the years back this work was done, and the ministry invested allot of money in it, yet no results were seen since the work was poorly done, almost to zero, many gave up on it! This time (As from July 018) you took the initiative as a team to review the documents word by word. First it was not in your key dates and I can imagine reading a document of more than two hundred pages word by word to ensure that each sentence and word is perfectly translated in reference to our context. Am sure some of you must have had sleepless nights just to make sure that this is achieved. \nMany were seeing this as an impossible task, but this team had no reason to give up; on September 2018, I saw an email from Program training manager informing TZ PF Staff that the translation review of Year 1 lessons for all ages has already been done and approved by NLT. What good news to our ministry! To some of our FCPs staff it was like a woman who has been waiting for a child for so long and all over a sudden God blessed her with a child at old years of her life. You went an extra mile for sure. The reviewing of this curriculum has helped CDWs and CYTs provide excellence and effective service to children, youth, church at large and over long run our Nation. Thanks so much training team for your commitment toward s this, I encourage you to keep the fire burning and go for Year two curriculum.\n',	'2018-12-11 12:15:58',	557,	557,	'2018-12-11 12:15:58'),
(1153,	132,	10,	3,	68,	'The team provided software that is helpful to staff',	'2018-12-11 12:16:32',	633,	633,	'2018-12-11 12:17:07'),
(1154,	132,	11,	3,	71,	'The team is providing leadership well to NO',	'2018-12-11 12:17:23',	633,	633,	'2018-12-11 12:17:57'),
(1155,	92,	3,	4,	553,	'Dear Mary.\nMy I appreciated your great effort in reviewing our curriculum for children and youth.\nYou committed yourself to the management that our Swahili curriculum could be reviewed.\nI am not sure if this big task was in your key date, but because of your positive attitude, hardworking spirit, the heart for the FCP and our beneficiaries you dared! You used your leadership skills to motivate your team despite their tight schedule to the extent that this activity started in the month of July and in September the year 1 curriculum for all ages was completed and sent to FCP’s through PF for implementation. Keep on with this spirit towards your team, every manager in our organization should imitate this. I love that!\n',	'2018-12-11 12:17:57',	557,	557,	'2018-12-11 12:20:19'),
