(1163,	92,	4,	4,	616,	'Dear Letema Samuel!\nI real appreciate the way you prepared logistics for foundation course which was expected to take place in Morogoro, but at the last minute the venue was changed by splitting the participants into two  groups ,one in Mwanza and one in Morogoro. In the month of November I realized that, other trainers were not in the office ,they were in the field performing their responsibilities. I could see you performing a lot of task up to long hours, that is extending the normal working hours to make sure that your fellow team members will not face challenges during training delivery. That showed a hardworking spirit and commitment to the ministry since you had to work all by yourself without giving up. Among the items I could see you working in include; printing and binding training materials, preparing and parking training manual, communicating with PF’S, participants and vendors through business unit among other activities that I may not have seen. Moreover, at the same month you went to extra miles of preparing material for TOT curriculum training which took place in Arusha. Kindly keep on with the same attitude towards work. Big up Letema!!!\n',	'2018-12-11 12:23:58',	557,	557,	'2018-12-11 12:24:29'),
