(1218,	137,	7,	4,	310,	'Moses is recognized for spearheading the developmental mindset and supporting partners to use local resource and also seek financial support/ training through CIVs. His passion is to support the church to minister to the whole child. He has submitted 9 CIV proposals he supported Masaka cluster to develop last week.. Previously, in his former cluster(Mpigi) he supported the cluster to draft their own strategic documents. He also Supported UG450 Kyanamugera CDC  design a CIV for over 170 families for food security and income generation.. Earlier on, in Kiruhuura cluster he supported 11 FCPs get funding for resource centers. He has also been assigned by Senior Manager of Partnership where he supported churches(Not ICPs) in Rukungiri to learn the qavah approach of resource mobilization. He also supported all FCPs in Kiruhuura to develop their strategic documents when he was their PF then.\nAt one time when other PFs were required to submit 4 proposals from their clusters, Moses was able to submit 22 proposals(18 proposals higher than the target) ',	'2018-12-12 07:34:44',	354,	354,	'2018-12-12 20:06:03'),
