(1290,	143,	5,	4,	330,	'Dear Christine, \nThis comes to appreciate you for your committed service as an employee Of Compassion International-Uganda, specifically for the role you played in managing New Beneficiary Registrations (Quota) between 2011 and June 2018 when we decided to have the project managed by Supporter and Donor Support Associates.\nYou managed to handle this huge project excellently well and ensured that the country has no variance for those 7 years. Thanks for shouldering this responsibility and putting the Organization’s interests ahead of your own. I know how you sometimes had to work over the weekends, on public holidays and over time to ensure that the quality of information we send to our Global Partners is excellent. These words can never say it well enough but please know that this ministry is blessed to have dedicated staff like you.\nI hold you in HIGH regard because you have created HIGH benchmarks for us all with your HIGH quality work.\nI am really proud of you and blessed to have you as an employee on my team. \nGod richly bless you.\n',	'2018-12-14 08:43:12',	309,	309,	'2018-12-14 20:49:02'),
