(2382,	238,	4,	4,	570,	'Edwin Mugisha, Stand for registered beneficiaries Durring sports Tournament. It has been two days that a selected Vendor for food prepare meal that never satisfy Children, all those days Children strive for food in Camp since Vendor Prepare small portion, some Children opt to sleep without eating since they miss food. Number of Staff were there, complains submitted to Commitee but no one opt to act accordingly, they just ask the Vendor to resolve that challange, dwin came there one night and experience the situation, what he did was not Bargaining with neither Committee nor vendor, he Oder the Vendor cancellation, I real appreciate his decision since the whole committee failed to do so, he Propose a well supplier that is mama Olasit, a Woman with Child heart, she serve a very good meal and enough, it reach a point beneficiaries who were at camp goes and appreciate Mama Olasit, and said that today we ate food from Compassion, not other Days.\nThank you Edwin for Standing for Saint Souls, you Shown us what it mean to stand for Children regardless what it takes but Child first. I real appreciate that.\nMay god Bless you So Much, and let it be Done to your Kin even in your absence, that was great sacrifice.\nBlessings.',	'2018-12-21 04:51:50',	609,	609,	'2018-12-21 05:04:04'),
