(2409,	240,	66,	4,	561,	'Titoya has demonstrated self-motivation on 29th September, 2018 when one staff was one leave and she was assigned to support his projects.   She discovered that some reports where not submitted and global deadline was on 30th which is Sunday. Titoya decided to come to the office on Saturday and communicated with FCP/PF in making sure all reports are received, quality checked and published to GPA on time.  Keep up the good work my sister. ',	'2018-12-21 08:47:59',	551,	551,	'2018-12-21 08:58:58'),
(2410,	240,	5,	4,	0,	'In operation metrics we had one metric of Unusable photo which was under rating our Unit and NO performance. Leaders came with an innovation of centralizing this metric to enable us excel. Cossem Pardon and Senyaeli Ndekirwa agreed to take charge of this task on behalf of all SDSA. Since July 2018 to date the number of unusable photo has dropped significantly and apart from that they educate SDSAs , FCP staff on how to take quality photos according to the standard required and this has made our team to minimize number of unusable photos received from FCP staff.  Remember they have number of projects assigned to them as the rest of SDSAs\n',	'2018-12-21 08:25:16',	551,	551,	'2018-12-21 08:41:48'),
(2411,	240,	4,	4,	586,	'In the month of September we had NBR entry for 10 FCP and she was innovative and make it enjoyable for every SDSA to do entry in due time without being exshausted  she moved all sdsa from their working cubes and they sit together in the dinning room upstaris for 3days having fun while doing entry and this resulted in submitting NBR timely with no variance ',	'2018-12-21 07:07:32',	551,	551,	'2018-12-21 07:30:25'),
(2412,	240,	68,	3,	0,	'SE unit demonstrate team work on Dec 17-21, 2018 by doing NBR entry for 3 new FCP from Eastern base.  Most SDSAs wanted to take part of their annual leave this week but when we shared we have a task ahead of us with January deadline they agreed not to go for leave and do entry as a team so as to make sure we accomplish that task timely. Remember in the team we have 2 expectant mothers also included in this race.\nThis is really  a great team.  Keep it up',	'2018-12-21 07:47:20',	551,	551,	'2018-12-21 08:16:43'),
