(2437,	243,	1,	4,	166,	'Yonah over the years I have known him;has been committed to the cause of releasing children from poverty in Jesus name-He always goes an extra mile to support others execute mission,He cares for others,he is always careful with his words and quick to say sorry when he offends,he has exhibited growth in his personal endeavors and his work.God bless you Yonah,you are such an inspiration!',	'2018-12-22 04:45:45',	358,	358,	'2018-12-22 04:49:08'),
(2438,	243,	4,	4,	290,	'Carol you are so committed to serving our Partners.As long as it\'s a child who is at risk,you will go an extra mile,even when your health couldn\'t allow you!! to pick a story to advocate for them.I love the way you relate to the Partners with dignity and respect and above all listen and appreciate the little things they do to make a difference in the lives of children!',	'2018-12-22 04:49:39',	358,	358,	'2018-12-22 04:52:16'),
(2439,	243,	2,	4,	300,	'Allan has been here for a short time,but has been able to innovate the GPs to help us locate our Partners with Ease.He revised the program assessment tool and currently working on a reporting template for program.Thank you!!',	'2018-12-22 04:52:31',	358,	358,	'2018-12-22 04:54:44'),
(2440,	243,	3,	4,	327,	'Lenny,I love the way you lead with confidence in the Lord.It seems you fear no one apart from Christ! and for this you inspire me.You lead with integrity of heart and skillfulness of hands,\"a tough mind and a soft heart\".I also love the work life balance and the way you admit that you aren\'t perfect.',	'2018-12-22 04:54:55',	358,	358,	'2018-12-22 04:57:36'),
(2441,	243,	5,	4,	361,	'Moses is focused,pro-active and committed to his work.He has acted as a stand in PF and currently handling 17 Partnerships(stand in) for the new FCPs in Bukwo. He is pro-active,there are countable times that I have reminded Moses to accomplish a task.He grasps concepts quickly and he is able to offer support to other peers e.g fast track etc.He has maintained good performance for the last 2 cycles in his business results.',	'2018-12-22 04:58:31',	358,	358,	'2018-12-22 05:09:39'),
(2442,	243,	7,	4,	317,	'Patrick is a servant leader,has good  problem solving skills,has a positive attitude,very flexible,endeavors to execute his duties to the required expectations and is accountable.He has been able to manage a cluster that is due for transition with ease even when they have been tough issues to handle during transitions of some of the Partnerships.',	'2018-12-22 05:05:20',	358,	358,	'2018-12-22 05:09:53'),
