(2465,	246,	5,	4,	542,	'Bayyo You have facilitated Turiani, Kilosa and Ifakara for two year and your work is Excellent. You have managed to empower the church leadership (Pastor) on local resource mobilization, where by the church has responded positive and locally mobilize the church members and parent in building infrastructures such as Latrines, modern offices and standard classrooms. I know it wasn\'t easy, but you had several meetings and sometime had encountered challenges, however you kept pushing and pressing it hard until all these happened. You always value the children and their safety, this has led you to encourage the pastor on environment cleanness and conservation. The church environment is now green with lot of trees, flowers and gardens. The surrounds community are amazed on how church environment differs from their house and this has caused them to imitate and change their home environment. For sure the church environment has real becoming safe place for the children to be in (child friendly environment.). \nAnd all these were implemented by church members and parents. This is amazing and not easily achieved it needs somebody whose excellent spirit is working in him like you Bayyo. Keep it up for the Glory of God.\n',	'2018-12-26 07:16:54',	615,	615,	'2018-12-26 07:42:39'),
