(4081,	401,	1,	4,	571,	'  During the week of March 11th to 15th, you  had staffs who have healthy challenges in your team.\nYou took it in your hand to follow up to know how they were progressing and not only that but on the second day  one of them had a serious challenge. Spouse of staff illness got worse and you were consulted on the same, you went further by leaving the training and start looking for possibilities of supporting the staff to get access to all the  requirement including the ambulance.  The best part  was the decision to accompany the staff to the referral hospital and spend the whole afternoon with them. This move went beyond your JD as a  Manager as it create assurance to staff that they can count on you when they go through difficulties.   Am not sure if this is part of your  responsibility of being a leader but it  is encouraging to  know that staff can rely on you  100% when they experience   challenges.\n This is a well done act brother ! may the Lord keep on using you for his glory.\n',	'2019-03-13 04:51:50',	595,	595,	'2019-03-13 05:02:32'),
