(4222,	440,	66,	4,	546,	'Shalom dear Remmy, \n\nI had the privilege of working together with Remmy Pascal Dumbi for more than one year in hosting Individual ang group visits. You have been an extra ordinary Person in such way you connected with sponsors. In February 2019 starting 15th to 25th, Remmy was Trip leader in Hosting US-sponsor Tour of 40 of sponsors. You demonstrated outstanding values which prompted me to recognize you. \nGod Almighty in His Word says, to give honor to whom honor is due and Remmy played such a vital part in the success of this past sponsor tour. There is so much to say about you and your leadership, as well as your love for God, and strong faith which shined so brightly during our time together and was noticeable by everyone not only me as core trip leader. \n\nYou placed God in the center of everything and it changes everything. You coordinated, and you prayed to many sponsors who had health challenges, they became well in Jesus name. They called you not only a host but a Pastor, this is beyond TVS. \n\nYour excellent time management skills, sense of humor and attention to details made me feel at peace and ease to learn many things from you. All the times, you were the keeper of Your words and therefore dependable and trustworthy to sponsors and donors. Your African dressing code motivated everyone. on 19th you took all sponsors to the local market to purchase fabrics (vitenge), You helped them bargaining and got better price, bargaining is not our culture (Said Claudia the trip leader), but you were there to help. Each sponsor got his/her favorite color. You went extra mile to organize the tailors, who took measurements to the sponsors at Kibo Place Hotel, ensured all sponsors get their clothes on time. I remember you were very tired after long day, but your smile confused everyone not to notice that you were tired. \n\nDespite of you being busy with other stuffs, you managed to monitor tailors (Fundi Cherehani) so that they finish the work on time. \n\nThe execution of the itinerary was done with professionalism and a caring heart, a rare combination. The trip leader Claudia loved and accepted the budget which is another vital part of hosting and planning that is demonstrated by you.  I know God has a great plan for you and will use you mightily in whatever capacity He sees you fit in. As you transition to the PF role, It is my prayer that God will use you. \nYou are a star Remmy!\n\nGod bless you brother. \n\n',	'2019-03-20 10:23:52',	565,	565,	'2019-03-20 10:24:42'),
