(4404,	465,	66,	4,	548,	'Suzan Golugwa\nShe took the CIT 20th anniversary by heart as she was extremely devoted right from the preparation until the last day when there was closing event. She took this event like there is no other activity on her table but nothing of her regular duties dropped.  She started to connect with Pastors, CDWs, beneficiaries and went extreme by getting in touch with the caregivers. This was to make sure everyone is aware, and everyone has a portion to do in the preparation team. Suzan coordinated all efforts and groups, most of the time she was there in person to make sure nothing drops on the way. \nWith the team of pastors and CDWs Suzan went physically to meet not only government officials at Regional office, she went to the Districts, Ward and even to the Local government officials for mobilization.  Apart from the mobilization of participants Suzan participated in the organizing meetings and many times she stayed until night. She participated in local events including street and market cleaning, tree planting, visiting of Elderly & Orphanage centres, blood donation to mention few. \nIt is amazing that within this short period of time Suzan became the fundraiser from banks, Public relation, the information collector (journalist), the editor and producer of an impressive Mwanza magazine special edition for CIT 20th anniversary that was distributed during final day. Quote: “I used to work long nights for this magazine”.  Pastors, CDWs and some other participants said about said about the event. “The event was wonderful”, “glory to God but Suzan was amazing”.  Some said, Suzan is a leader a leader, she is a machine, she is a thinker, she is a servant of God, she will go far.  \n',	'2019-04-08 11:35:04',	614,	614,	'2019-04-08 11:40:48'),
