(4433,	472,	7,	4,	614,	'For every one on one that i sit wit Pando; You will find he has all the details about each FCP and how it is doing.Do the follow up closely and ensuring each PF is supported and understand what is required. In this month of April Pando had Four FCPs with challenges; of which He developed action plan and shared with me as Supervisor. He visited and conducted meeting; went beyond and visited the Bishop several times of those Churches to seek their support and intervention on the issues. His passion to see every PF is supported in such a way that each is working smoothly and nothing pending issues that hinder a PF to do his work well. I believe his staff can testify of such readily available support not only for FCPs with partnership challenges but also during celebrations moments.  As His supervisor i sit relaxed knowing what is going in his Base and knowing the Manager is on top of all details. That is something to cherish and motivate in all.  ',	'2019-04-18 08:04:23',	570,	570,	'2019-04-18 08:16:24'),
(4434,	472,	4,	4,	590,	'This month of April 2019, I had an opportunity to visit Ngorongoro cluster. Apart from many things that i saw I was amazed on the  person who did the Baseline survey. By this time Yes the baseline survey was done years Back but I have come to note it after visiting and i think it is worthy of recognition. Ezekiel by was a Manager and personally he conducted the survey with accompany of PF. Looking at the nature of the community and all challenges surrounding the community of ngorongoro in relation to what Compassion we have been doing and are used to do. It was not easy and not within normal requirement for someone to recommend Ngorongoro FCP for partnership. It must take someone with heart for Children and who see beyond the call of duty to be able to recommend such Churches. I remember to have challenged Ezekiel if at all we will be able support effectively. He was real conviced in His Heart and his compassion for those Children in needy. In short Churches were not qualified for partnership, the area was not qualified too but the need was too high and you can not look at those community and remain stick with your guidilines only. Thank you Ezekiel. I am proud of you.',	'2019-04-18 07:45:51',	570,	570,	'2019-04-18 07:53:47'),
(4435,	472,	66,	4,	592,	'I lack words to express this incident I observed after visiting Ngorongoro cluster. I remember i told Msegu that I am sending you to Ngorongoro as Special task that require special attention. I knew in my heart the difficultines of the area and needed someone who can see all possibilities. I was amazed what Msegu has done to the community, the Churches and the children. His facilitation model was evident during my visit. Engaging the government (local givernement), engaging the Authority of Ngorongoro, and the community and mobilize them all to be able to support the Churches and the Child ministry in that area. Looking at the accessibility of the area it is not easy and you need courage to be able to drive office Car alone in those forests. The churches because of education level of the community required a PF to visit them more frequently. explaining all details and repeat several times for them to grasp. Mobilizing other key stakeholders and staff from office for support. By the time I visited those Churches were more engaged even beyond other churches that are in good areas and accessible with good education. This was beyond the call of duty of a PF for sure and it require self motivation to go that level. Msegu you are a Champion of the Ministry.',	'2019-04-18 07:53:45',	570,	570,	'2019-04-18 08:03:34'),
