(4811,	516,	4,	4,	622,	'During the L4L Jethro principle intervention meeting in Lake base in March 2019, Sarah dedicated time during break hours for counselling sessions to Youth. She was able to  have one on one sessions  with young leaders that had personal struggles that they  felt they couldn’t openly share during the young leaders workshop. After the counselling  sessions the Youth were encouraged and  promised to give feedback on the progress.',	'2019-04-23 01:22:47',	606,	606,	'2019-04-23 13:23:28'),
(4812,	516,	66,	4,	623,	'Dada Rhoda showed such a self-motivation that everyone need to have to serve the children. Survival Strategy was to be accomplished after receiving the allocated targets from GMC. Other data was already collected but the allocated targets was missing.  She received the targets on the 15th of March giving room for only 30 days including Saturdays and Sundays to allocate the funds for FY 20, 21 and 22 and receive current baseline reports from PFs as supporting documents to accomplish the requirement of the strategy.  So the targets came very late giving a very short time and the deadline for submission was on the 15th of April. While writing the  strategy other activities had to continue, like attending to CFT meetings in  lake Victoria and western base, and supporting FCPs to submit Q3 Survival activity reports and approving slots in connects, data cleaning etc. TZ Survival strategy was  submitted on the 15th of April as it was planned. This was accomplished by working day and night including Saturdays’ and Sundays to ensure it is submitted as scheduled. The tool would not allow working outside compassion Network, therefore I worked from the office on Saturdays and on Sundays just around the office premises to be able to connect to Psalms wireless. Even today other African countries are still working on the strategy because the tool was very complicated and not user friendly. ',	'2019-04-23 01:20:34',	606,	606,	'2019-04-23 13:21:39'),
