(4830,	516,	2,	4,	551,	'In Feb 2019, Patricia challenged New Sponsor Letter dashboard. The overdue report for NSL was not giving proper information. When she was given an opportunity to say what should be done to correct the situation and have the dashboard provide useful reports, she was challenged by the GMC staff but continued to insist on what should be best for her team. Finally, in the same month, GMC understood what she meant and the point in correcting dashboard report and that change was Instituted throughout CI Countries.  These changes will reflect NSL that have not been received in the NO by its due date as overdue by starting to appear in the dashboard regardless the difference in number of days since it was printed and sent to FCP.\nAll CI countries had a lot of NSL overdue reflected in the dashboard that where not overdue, by this initiative it really reflects accurate number of overdue per NO\n\nWhat an Initiative Innovation Patricia, Keep doing what you do with Excellence and Passion!!\n',	'2019-04-23 02:19:54',	606,	606,	'2019-04-24 06:46:37'),
