(5042,	541,	4,	4,	574,	'In April 2019,Erasto visited TZ0839 soon after  you had graciously accepted to Facilitate Monduli Cluster FCPs following retirement of Salvatory Nyambo, Your visit discovered that  58 children were using small single room for nursery school, there were also no qualified teachers, and so children had very poor performance. Immediately   you ordered the Partner to shift all children to public nursery school, where you also facilitated to ensure they are accepted.Regardless of the threat from the Partner and his attempt to persuade the headteacher not to accept those children, you stood firm and advice the headteacher to put in writing that there is no space for those children.At the end the headteacher  was afraid and did accept the children, employ specific teacher for our children , more than that monthly  school fees dropped from 10,000/= that we were paying the Church to 7500.Generally you saved 145,000 per month, equal to 1,450,000/= per year.\nErasto, this was such a daring attempt, knowing that it could affect your relationship with the church partner and more worse Monduli cluster in general .\nYou are the Hero. Iam  Very proud of you',	'2019-04-24 11:15:38',	625,	625,	'2019-04-24 11:51:02'),
