(5073,	541,	5,	4,	574,	'Erasto is a PF for Kateshi and Babati with total 12 FCPs which are official acceptable PF ratio,while we  are in the process to recruit new PF for Monduli after the retirement of Nyambo,Early April, Erasto  was consulted and willingly agreed   to support the FCPs, which made him to facilitate  total of 20, this is far beyond PF FCP ratio for one person.Regardless of the heavy weight he has been able to review all 20 financial reports timely, raise critical issues for each individual FCP, as we speak Erasto has written a letter to all implicated Partners for followup,hold  two critical partnership meeting for TZ115 and TZ0839,The meeting  has necessitate the Pastor of TZ115 who was  passive on Child Ministry issues to quickly wake up and start working and supporting the ministry, he has mobilized Ngorongoro base PF for program  check to ensure children and Youth are well Ministered in Monduli Cluster.\nErasto has worked  day and night to support his 20 FCPs,Regardless of the heavy weight, no delay of information to or from the FCP or his supervisor,All needed reports like CIV and Monthly report were in good quality and timely.He has been able to also provide global access to Compassion Connect for new 16 FCPs of lake base which was delayed since March 2019 until when Erasto jumped in  the midst of all  to support the FCPs. \nErasto has never complained neither giving any excuse for not doing a given assignment.\nThis is nothing less than great commitment and, sacrifice for the  Children and Youth of Tanzania\nAsante sana Erasto Malila, ',	'2019-04-24 12:06:57',	625,	625,	'2019-04-24 12:42:49'),
(5074,	546,	3,	4,	664,	'Nathan demonstrates leadership skills by treating all staff members equally and solve problems individually and everyone is happy with his leadership skills',	'2019-04-24 12:07:06',	712,	712,	'2019-04-24 12:09:42'),
