(5076,	548,	16,	2,	3,	'More specific to Nicodemus Karisa, Livingstone Onduso & Julius Muchori|Dear GTS team in Africa, more specifically to Nicodemus Karisa, Livingstone Onduso & Julius Muchori, you have highly demonstrated Compassion cultural behavior says \'\'100% for one another\'\'. I remember we presented our need to you that we need LMS for equipping FCPs, it was in November 2018, without hesitating you quickly responded and designed the system for us, not enough on February 4th to 8th, you came physically to Tanzania for face to face training, you wanted to make sure we understand the system, apart from face to face training, you continued to equip us through zoom meetings. What a spirit! really you have demonstrated an outstanding behavior on this category, keep it up! for God\'s people and for His Glory. We really thank you so much.',	'2019-04-28 06:03:54',	553,	553,	'2019-04-28 07:07:36'),
