(5099,	551,	4,	4,	615,	'Among of Leaders Shiphra became a ledre who listern and she is a frontline leader in implement. On February Siphra Organise the team and encourage to Paticipate in the Event of SZSF at Mlimani City, regardless that Shiphra staying far from the place but she was the first one to be in the venue, she participated the event till the end, we escot her to her home and she reach her home at 3:45 Am, i immagine that courages hear, she opt to left her home, her husband and her Children for Registered beneficiary and the event, she had an opportunity to assign other staff to go since she is a leadre but she said no i will participate on that. it was weekend, she never count that but she sacrifice that.\nMay God Bless you  Shiphrah, no that we are you and we love you always.',	'2019-04-24 01:03:55',	609,	609,	'2019-04-24 13:03:58'),
(5100,	382,	7,	4,	552,	'Nancy demonstrated good leadership skill in term of supporting her business support unity and work as team. Team work in this team has greatly improved. There is vivid leadership input to this team improvement that has been so evident between March to April 2019. This has been possible through weekly unit meeting that has done a lot to cement teamwork spirit among the team. Keep up the course!',	'2019-04-24 01:04:26',	571,	571,	'2019-04-24 13:18:03'),
(5101,	554,	1,	4,	86,	'Simplice a toujours été disponible à 100% lorsque le besoin s\'est fait sentir ; non seulement sur le plan professionnel mais aussi en dehors du travail. Il m\'a toujours guidé à travers des conseils dans la relation avec les partenaires. Ce qui m\'a le plus marqué, c\'est quand, ce 18 décembre 2018, alors qu\'on s\'activait pour les congés, je reçois ce mail :\n« Bonsoir a vous mes bien-aimés frères en Christ. Je pensais a vous dans vos clusters respectifs et voudrais sincèrement vous porter dans mes sujets de prières de ce mois. J’aimerais donc humblement si vous voulez partager avec moi des sujets qui vous tiennent à cœur afin que je m’associe a vous pour plaider devant le trône de grâce de notre Dieu Tout-Puissant et Tout Suffisant. Votre frère en Christ et d’un collègue qui vous porte dans son cœur. Simplice »\nPour moi, ça a été la forme la plus achevée du 100% disponible l’un pour l’autre qu’il m’a démontré en m’amenant par la même occasion à l’ « Invite in ».',	'2019-04-24 01:04:39',	94,	94,	'2019-04-24 13:12:41'),
