(5109,	554,	3,	4,	110,	'A chaque fois que j\'ai l\'occasion d’échanger avec Laurent, c\'est avec plaisir et beaucoup d\'admiration que je m\'y adonne tellement il semble être né dans le ministère. C\'est aussi quelqu\'un a qui j\'ai toujours fait recours pour qu\'il m\'aide a gérer des situations complexes dans le cadre du service. Et c\'est en ce moment qu\'il étale toutes ces qualité de leader, de meneur d\'hommes pour, non pas me donner la solution, mais pour susciter des réflexions qui vont moi-même m\'aider a trouver le chemin le plus adéquat a suivre.\nTres sincèrement, je bénie le Seigneur pour sa vie et pour ce qu\'il me donne de travailler a ses cotes dans le même ministère.',	'2019-04-24 01:12:54',	94,	94,	'2019-04-24 13:18:03'),
