(5384,	443,	1,	4,	45,	'Richard exhibited the cultural behavior of Here for a reason-the mission when the office hosted Bishop TD Jakes and his business partners in March 2019. A committee was set up to handle this high profile visit. As part of the preparation, packets containing information of CIGH and the FCP was to be developed and printed for all the visitors. The printer promised to deliver the packets at 4pm a day to the visit but he was not able to fulfill his promise. Richard who was not a member of the committee and happened to be going home after office hours decided to follow up on the printer when he got to know about the situation. He eventually stayed with the printer in his company and  carried the printed packets to the office after 9pm. In addition, Daniel Adjei and Wilberforce Darko also decided to wait for Kissi to help him pack the packets. The three of them did this in the night and left the office around 10pm. The next day Kissi managed to pick up the packets and other items from the office around 5am and delivered them to the visitors  lodging at Kempisky hotel at 6am. A team from GMC and Kenya who also participated in the tour decided to visit the Capecoast castle on sunday. This was an unplanned trip. When Kissi was called upon by his supervisor Robert to drive the team to capecoast on sunday, Kissi willingly did. In short Kissi focused on what mattered most and willingly sacrificed for the good of the whole. He contributed in making the visit a success.',	'2019-04-26 12:37:35',	16,	16,	'2019-04-26 13:21:56'),
