(5397,	443,	3,	4,	39,	'Wilberforce has demonstrated excellent leadership as the chairman of the muskathlon 2020 committee. He led the committee and developed the itinerary and budget for the pre scout team working with muskathlon team based in Compassion Germany and Denmark. He followed up on all his team members to ensure the pre scout visit was successful by organising on site visits to engage external stakeholders and FCPs prior to the arrival of the muskathlon team. Feedback from the visitors was very positive. He also kept NLT and staff updated on progress. He also submitted reports on all major activities to me. Finally he called for timely support when it was needed.',	'2019-04-26 01:22:28',	16,	16,	'2019-04-26 13:33:25'),
(5398,	443,	4,	4,	56,	'Ivy demonstrated excellent service to GH0407 and beneficiaries when the General Secretary of the Evangelical Alliance of Switzerland visited the office in February 2019. Staff in CI Switzerland alerted the office that a sponsor who was visiting CI Ghana was a known critic of NGOs in Switzerland and he had concerns about the child sponsorship concept of CI ministry. \nArmed with this information, i asked Ivy to participate in the visit although it was an individual visit and there was no need for the tours and visit to participate. Moreover the notice was short and the visit fell on a Saturday. Whiles at the FCP, Ivy quickly organized herself and made a presentation to the visitor when she realized the FCP was not fully up to task on their presentations although she didn\'t plan for it. This singular effort by Ivy placed CIGH and entire Compassion ministry in the good books of the General Secretary of the Evangelical Alliance of Switzerland.\n\nFind below the heartwarming message from the CEO of Cmpassion Switzerland\n\"Let me express our deep thankfulness for the day you organized for Marc Jost and his family. I spoke with him and he and his family were really touched to discover the real extreme poverty and the «impressive work of Compassion» (his words). \n\nAs you know, he - as the general secretary of the Evangelical Alliance for our country as well as chairman of the evangelical mission platform - was not a very supportive voice for Compassion Switzerland.\n\nHe came back to Switzerland with a good understanding of Compassion sponsorship benefits and a much more positive opinion on Compassion’s mission.\n\nAgain, thank you so much for the organization of this strategic visit. \n\nIn the name of Compassion Switzerland team, I wish you renewed hope, strength for the precious work you do. We are proud to be on the same team than you, putting all our efforts to find every day more sponsors. \n\nBest regards,\n\nChristian WILLI\nCEO Compassion Switzerland\n',	'2019-04-26 01:33:33',	16,	16,	'2019-04-26 13:53:22'),
