(5493,	600,	66,	4,	568,	'Dear Modester, thank you so much for your commitment and invaluable contribution to the 20th Anniversary event on 27th April 2019. You were assigned to find three suppliers’ food on the event day and each supplier was required to serve 1000 beneficiaries. On 26th April evening you went beyond your responsibility by visiting suppliers’ homes and check the way they were preparing food, number of people who were preparing food, how the whole exercise was done. After the visit you decided to change the number of children who would be served for each supplier according to their capacity without coming back to the main committee. That was a wise decision, that made every beneficiary got food on time on 27th April. \n\nDear sister, you have shown great capacity to do follow up and make sensitive decisions independently. May God continue to bless you abundantly. \n\n \n',	'2019-04-28 02:53:14',	619,	619,	'2019-04-28 16:02:08'),
