(5540,	606,	1,	4,	621,	'The Month of April 2019, was the Month of celebrating 20 years of Compassion International Tanzania (CIT). Our Base that is Western Base took the first week of April 1st to 6th 2019, as part of this remarkable event with the campaign of environmental cleanliness and conservation. Dear Janeth Shayo, during this period, you were going through a challenge whereby your beloved Father passed away, very sorry for that!. Dear Janeth Shayo, you demonstrated compassion  cultural behaviors with an exceptional heart. Firstly, you demonstrated a behavior of inviting others in, by making sure you arrange someone to act on your behalf in Tabora Cluster before you travel for the funeral of your passed away beloved Father.\nThis was amazing because you encouraged yourself in the Lord though  you were going through a painful moment. Not only that, but also when you were there at your home for funeral, you demonstrated a behavior of \"100% for one another\" whereby continued communicating with the team there in Tabora to see what is going on and what could need your immediate support just for making everything goes as planned. Therefore, your heart is blessed because you were going through a difficult moment but encouraged yourself in the Lord hence demonstrated these behaviors amazingly.\nGod bless you and press on serving Him for His glory!. ',	'2019-04-29 09:05:21',	572,	572,	'2019-04-29 09:59:56'),
